css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

a.new_post_label > i {
  height: 90px;
}
.new_post_label/*_icon*/ > I {
	background: url('data:image/png;base64,') no-repeat !important;
	z-index: -1;
}

.new_post_label:nth-of-type(1) > I {background-position: 2px -5px !important}
.new_post_label:nth-of-type(2) > I {background-position: -73px -1px !important}
.new_post_label:nth-of-type(3) > I {background-position: -148px -5px !important}
.new_post_label:nth-of-type(4) > I {background-position: -223px -1px  !important}
.new_post_label:nth-of-type(5) > I {background-position: -298px -5px !important}
.new_post_label:nth-of-type(6) > I {background-position: -373px -1px !important}
.new_post_label:nth-of-type(7) > I {background-position: -448px -5px  !important}

.new_post_label {
	font-size: 0 !important;
}

.new_post_label:hover > I {
	border-bottom: thick solid rgb(248,198,77) !important;
}

.new_post_label > I {
  color: transparent !important;
  transition: background-position .08s linear !important;
}

}
